export const Footer = () => {
  return (
    <section className="lg:h-[460px] ">
      <div className="bg-footerBg bg-no-repeat bg-cover w-full m-0 relative h-[100%]">
        <img
          className="lg:flex m-0 lg:w-auto object-cover absolute h-[50%] top-[50%] left-[5%]"
          src="/treaty-png-1.svg"
          alt=""
        />
        
      </div>
    </section>
  );
};
